import { Routes ,Route } from 'react-router-dom';
import Home from "../pages/Home";
import Footer from "./Footer";
import Header from "./Header";

export default function Body(){
    return(
      <>
      <Home/>
      <Routes>
          <Route path="/home" element={<Home/>} />
    </Routes>
      </>
    )
    
}
